    "2016-07-27T22:41:57.511918",nt"name": "dioxin-contamination-in-fishes-water-birds-and-raccoons-of-the-upper-ouachita-national-wil",nt"isopen":
    false,nt"url": null,nt"notes": "The Ouachita River and adjacent Upper Ouachita
    National Wildlife Refuge, located in north-central Louisiana, are subject to several
    types and sources of contamination. During the spring of 1993, largemouth bass,
    water birds, and raccoons were collected for dioxin analyses. Largemouth bass fillet
    and carcass samples were analyzed for several dioxin/dibenzofuran congeners. Raccoon
    and bird wholebody samples were analyzed for 2,3,7,8-TCDD and -TCDF only. The analytical
    results indicated the presence of dioxin at levels warranting concern in all biota
    analyzed, particularly in the water birds. Bioaccumulation in water birds was the
    most significant; the maximum level observed was a lipid adjusted Toxicity Equivalency
    Concentration of 953.6 pg/g (parts per trillion) in a great blue heron. Dioxin contamination
    is discussed in terms of the published literature on known hazards to fishes and
    reproduction in piscivorous water birds and raccoons.",nt"license_title": "License
